import React from 'react';
import logo from './logo.svg';
import './App.css';
import PokemonCard from './PokemonCard.js'
import PokemonPage from './PokemonPage.js';
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Link
} from 'react-router-dom';

function Home(props) {
  return (
    <div>
      <h1>Home</h1>
    </div>
  );
}

